import React from "react";
import { Routes, Route } from "react-router-dom";
import {
  Home,
  About,
  Events,
  Products,
  Contact,Login
} from "./components/pages";
import LoginPage from "./components/pages/LoginPage";

import './css/common.css'

export function App() {
  return (
    <div>
    abel
      <Routes>
        <Route path="/" element={<LoginPage/>} />
        <Route
          path="/about"
          element={<About />}
        />
        <Route
          path="/events"
          element={<Events />}
        />
        <Route
          path="/products"
          element={<Products />}
        />
        <Route
          path="/contact"
          element={<Contact />}
        />
      </Routes>
    </div>
  );
}
